{"operationName":"blocks","variables":{"timestampFrom":1672870200,"timestampTo":1672870800},"query":"query blocks($timestampFrom: Int!, $timestampTo: Int!) {
  blocks(
    first: 1
    orderBy: timestamp
    orderDirection: asc
    where: {timestamp_gt: $timestampFrom, timestamp_lt: $timestampTo}
  ) {
    id
    number
    timestamp
  }
}
"}
